    [],nt"revision_timestamp": "2015-03-01T02:39:02.085094",nt"name": "final-report-on-vegetation-community-surveys-2005-2006-and-botanical-and-zoological-survey",nt"isopen":
    false,nt"url": null,nt"notes": "In 2004 and 2005 the Delaware Natural Heritage
    Program took an inventory of plants, animals, vegetation communities of Prime Hook
    National Wildlife Refuge. This study represents the first comprehensive biological
    inventory of the refuge. Thirty four vegetation communities and three land cover
    types related to development were discovered on the refuge. Botanical inventories
    documented 427 species of vascular plants were growing on the refuge, of which forty
    three are considered to be rare or uncommon within Delaware. Zoological inventories
    concentrated on species of potential conservation concern. Thirty one species considered
    to be rare in Delaware were discovered on the refuge.",nt"license_title": "License
